import React from "react"
import styles from "../App.module.css";
import {FaWindows, 
	FaPlaystation, 
	FaXbox, 
	FaApple, 
	FaLinux, 
	FaAndriod
} from "react-icons/fa";

function PlatformIconList(game) {
	return (
		<>
		{game.platform.map(platform => (<p className={styles.platform} key={platform.platform}> {platform.platform}</p>))}
		</>
	);

}

export default PlatformIconList;
